import Header from "../components/header";
import Main from "../components/main";
import Section from "../components/section";
import Footer from "../components/footer";
import Article from "../components/article";

const Home = () => {
  return (
    <>
      {/* header start  */}
      <Header />
      {/* header end */}
      {/* main start  */}
      <Main />
      {/* main end */}
      {/* section start  */}
      <Section />
      {/* section end */}
      {/* article start  */}
      <Article />
      {/* article end */}
      {/* footer start  */}
      <Footer />
      {/* footer end */}
    </>
  );
};
export default Home;
